import * as React from "react";
import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";
import App from "./App";
import Allfeatures from "./Allfeatures/Allfeatures";
import Alldownload from "./Alldownload/Alldownload";
import Allproduct from "./ProductPage/Allproduct";
import Pizza from "./pizza/Pizza";
import AllShopping from "./ShoppingPage/AllShopping";
import AllCart from "./cart/AllCart";


const router = createBrowserRouter([
  {
    path: "/",
    element: <App></App>

  },
  {
    path: "/",
    element: <App></App>

  },

]);

createRoot(document.getElementById("root")).render(
  <RouterProvider router={router} />
);
